import React from 'react';

const Error = () => {
    return ( 
        <div className="ui secondary  menu"><div className="ui container"><center><a href="/"><img src="img/koompi-logo-w-01.svg" height="35px" className="mobile hidden"/><img src="img/koompi-logo-w-02.svg" height="35px" className="mobile only"/></a></center><div className="menu right"><a className="item navbarTop menuFadeIn" href="/feature">Feature</a><a className="item navbarTop menuFadeIn" href="/about-us">About</a><div className="item"><i className="fas fa-times btnAnimationClose"></i></div></div></div></div>
     );
}

export default Error;
